INSERT INTO `catalogo_categoria` (`itemId`, `nombre`, `padre`, `class`, `descripcion`, `orden`, `activo`, `core`, `admin`, `privado`, `dateCreate`, `dateUpdate`, `userCreate`, `userUpdate`) VALUES
	(1, 'Recursos Hídricos', NULL, NULL, NULL, 1, 1, 0, 0, 0, '2018-07-12 13:00:57', '2018-07-12 13:00:57', 1, 1),
	(2, 'Medio Ambiente', NULL, NULL, NULL, 2, 1, 0, 0, 0, '2018-07-12 13:01:12', '2018-07-12 13:01:12', 1, 1),
	(3, 'Inversiones Nacionales', NULL, NULL, NULL, 3, 1, 0, 0, 0, '2018-07-12 13:01:32', '2018-07-12 13:01:33', 1, 1),
	(4, 'Evaluación del Desempeño Sectorial', NULL, NULL, NULL, 4, 1, 0, 0, 0, '2018-07-12 13:02:14', '2018-07-12 13:02:14', 1, 1),
	(5, 'Herramientas', NULL, NULL, NULL, 5, 1, 0, 0, 0, '2018-07-12 13:02:30', '2018-07-12 13:02:30', 1, 1),
	(6, 'Administrativas', NULL, NULL, NULL, 6, 1, 0, 0, 0, '2018-07-12 13:02:42', '2018-07-12 13:02:42', 1, 1),
	(7, 'Planificación Hídrica', 1, 'flaticon-squares-3', '<p><b>La planificación</b> hídrica está enfocada en establecer la coordinación intergubernamental e intersectorial para desarrollar la gobernanza de los recursos naturales a nivel de las Cuencas Estratégicas, dependiendo de la problemática específica de la misma. El proceso comprende: </p><p>i) el establecimiento de las estructuras de gestión (unidad técnica, plataforma intergubernamental/intersectorial); </p><p>ii) el diagnóstico de la cuenca, incluyendo el análisis de procesos relevantes (e.g. cambio de uso de suelo, efectos del cambio climático); iii) la identificación y priorización de intervenciones y la inversión concurrente en medidas de GIRH-MIC, desembocando en un PDC; iv) implementación, monitoreo, evaluación y ajuste del Plan.</p>', 1, 1, 0, 0, 0, '2018-07-12 13:03:08', '2018-10-04 09:46:10', 1, 1),
	(8, 'Disponibilidad de Agua', 1, 'flaticon-diagram', 'Para la planificación de cuencas es necesario contar con información sobre la disponibilidad de agua, entiende esta como el volumen total de agua ya precipitada en una cuenca que puede ser utilizada para riego, generación de energía eléctrica, abastecimiento de agua potable, etc, para lo cual en la gestión 2017 se elaboró el Balance Hídricos, que es un análisis del agua que ingresa al sistema y la que salen del mismo, en un intervalo de tiempo determinado.\r\nPara la generación de balances hídricos, los datos climáticos e hidrométricos existentes constituyeron la base de datos para alimentar los algoritmos de cálculo. En este caso, durante las etapas iniciales del procesamiento de datos, se lograron identificar retos como la escasez de datos en algunas regiones, la necesidad de filtrar los mismos para poder contar con información confiable, el procesamiento requerido para aquellos que se evaluaron como válidos, y la inclusión de los criterios de decisión para relleno y completado de series de tiempo identificadas como válidas y confiables. La base de datos para el período de tiempo de 36 años de 1980-2016 fue facilitada por el SENAMHI. Además, debido a la existencia de cuencas compartidas con otros países, fue necesario obtener datos de Perú, Brasil, Chile, Argentina y Paraguay a través de sitios WEB y convenios del SENAMHI con los servicios meteorológicos extranjeros. De esta forma, se logró completar una base de datos para obtener el balance hídrico en todas las cuencas internas al país y también en aquellas compartidas con los países limítrofes. \r\n', 2, 1, 0, 0, 0, '2018-07-12 13:03:24', '2018-07-12 13:03:24', 1, 1),
	(9, 'Calidad de Agua Superficial', 1, 'la la-tags', 'Es una medida que se encuentra relacionada con la  determinación de la aptitud de uso del cuerpo de agua; excedentes a los límites permisibles del Reglamento en Materia de Contaminación Hídrica (RMCH);  la representatividad de los parámetros entendida como su presencia en la mayor parte de los puntos monitoreados, la comparabilidad que muestra que los parámetros estén comprendidos en el RMCH con valores superiores a cero; la  criticidad que muestra el número de veces que el contaminante está en exceso en el cuerpo de agua y la correlación  entre parámetros.', 3, 1, 0, 0, 0, '2018-07-12 13:03:36', '2019-01-14 20:02:40', 1, 1),
	(10, 'Usos de Agua', 1, 'fab fa-linode ', 'Se presentan multiplicidad de usos del agua, siendo estos aspectos de primera necesidad de la población (agua potable), la producción (agricultura, industria, energía, transporte) y de preservación del medio ambiente (caudales ecológicos, protección de cuencas, biodiversidad), entre muchos otros.\r\nEn este marco se cuenta con información sobre las fuentes da agua para riego y el otorgamiento del uso de las mismas, la ubicación de los sistemas de riego, superficie bajo riego, de la cobertura de agua potable y saneamiento básico, de las presas y embalses, y de las plantas de tratamiento de aguas residuales.\r\n', 4, 1, 0, 0, 0, '2018-07-12 13:04:05', '2018-07-12 13:04:06', 1, 1),
	(11, 'Riesgos Hidrológicos', 1, 'flaticon-exclamation-1', 'En la gestión de riesgos hidrológicos y de cambio climático hace énfasis en los aspectos de prevención, a través de la promoción de una adecuada gestión de las cuencas, la introducción de técnicas e infraestructura climático-resiliente, la alerta temprana hidrológica, el respeto a las franjas de seguridad en los márgenes de los ríos, el desarrollo de capacidades y actitudes de prevención en la población y las autoridades, y la implementación de proyectos de protección contra sequías e inundaciones. ', 5, 1, 0, 0, 0, '2018-07-12 13:04:29', '2018-07-12 13:04:30', 1, 1),
	(12, 'Gestión de la calidad Ambiental', 2, 'flaticon-graphic-1', 'Comprende el conjunto de decisiones y actividades orientadas al desarrollo integral para vivir bien, la gestión ambiental implica estrategias destinadas a prevenir, minimizar, mitigar, y controlar la contaminación ambiental e incorporación de tecnologías limpias en procesos, programas, proyectos y obras multisectoriales.', 1, 1, 0, 0, 0, '2018-07-12 13:05:57', '2018-07-12 13:05:57', 1, 1),
	(13, 'Desarrollo y Gestión Forestal', 2, 'la la-leaf', 'Bolivia es un país predominantemente forestal, sexto en extensión de bosques tropicales en el mundo y quinceavo en cobertura boscosa. En este marco, los últimos años se han desarrollado diversos procesos para el impulso de la economía forestal, los cuales promueven el incremento del aprovechamiento de especies forestales maderables y no maderables mediante planes de gestión integral del bosque; asimismo se viene impulsando e implementando el Programa Nacional de Forestación y Reforestación, en coordinación con diferentes entidades públicas y privadas, y con las Entidades Autónomas Territoriales.', 2, 1, 0, 0, 0, '2018-07-12 13:06:35', '2018-07-12 13:06:35', 1, 1),
	(14, 'Biodiversidad y Áreas protegidas', 2, 'la la-optin-monster', 'La biodiversidad reviste importancia estratégica por sus múltiples funciones ambientales y su grado estratégico: la alimentación proviene de la diversidad biológica, los combustibles fósiles son subproducto de ella, las fibras naturales también; el agua y el aire están ligados a ciclos naturales con gran dependencia en la biodiversidad, la capacidad productiva de permite también el desarrollo de procesos biológicos y ecológicos tales como corredores biológicos, áreas de reserva natural o de captación de agua, reservorio genético, fuente de recursos silvestres para la seguridad alimentaria, belleza escénica, que en conjunto contribuyen al bienestar de la población en general. Los suelos dependen de su diversidad biológica, y muchos otros beneficios de los cuales depende la supervivencia humana.', 3, 1, 0, 0, 0, '2018-07-12 13:06:57', '2018-10-25 08:40:49', 1, 1),
	(15, 'Inversiones', 3, 'flaticon-piggy-bank', 'En la última década las inversiones en los sectores de riego, manejo integral de cuencas, agua potable y saneamiento básico, residuos sólidos y forestación se incrementaron, generando como resultado la ampliación de las coberturas de agua potable, de saneamiento básico, de riego y de hectáreas con forestación y reforestación.', 1, 1, 0, 0, 0, '2018-07-12 13:07:35', '2018-10-25 09:04:40', 1, 1),
	(16, 'Programas y Proyectos MMAyA', 3, 'flaticon-transport', 'El Ministerio de Medio Ambiente y Agua gestiona la implementación de diversos programas sectoriales a nivel nacional, mediante los cuales se financia proyectos en riego, agua potable, saneamiento básico, cuencas y forestación. ', 2, 1, 0, 0, 0, '2018-07-12 13:07:50', '2018-07-12 11:07:51', 1, 1),
	(17, 'Evaluación del Desempeño Sectorial', 4, 'flaticon-graphic', '<p><br></p>', 1, 1, 0, 0, 0, '2018-07-12 13:09:14', '2018-10-25 09:51:11', 1, 1),
	(18, 'Herramientas', 5, 'flaticon-cogwheel-2', NULL, 1, 1, 0, 0, 0, '2018-07-12 13:09:26', '2018-07-12 13:09:26', 1, 1),
	(19, 'Gestión Administrativa', 6, 'flaticon-map', '<p><br></p>', 1, 1, 0, 0, 0, '2018-07-12 13:19:49', '2018-10-02 18:29:08', 1, 1),
	(20, 'Planificación', 6, 'flaticon-analytics', NULL, 2, 1, 0, 0, 0, '2018-07-12 13:10:03', '2018-07-12 13:10:04', 1, 1),
	(21, 'Intranet', 6, 'flaticon-open-box', NULL, 3, 1, 0, 0, 0, '2018-07-12 13:10:11', '2018-07-12 13:10:11', 1, 1),
	(23, 'Capacitación Desarrollo', 6, 'flaticon-squares-1', '<p><br></p>', 99, 1, 0, 0, 0, '2018-11-16 10:04:21', '2018-11-16 10:04:34', 1, 1),
	(24, 'Administración SIARH', NULL, NULL, NULL, 7, 1, 0, 1, 0, '2019-04-08 17:19:21', '2019-04-08 17:19:21', 1, 1),
	(25, 'Configuración de SIARH', 24, 'flaticon-cogwheel-2', '<p>Configuración del Core del SIARH, para añadir subsistemas, generar menus de la mascara, administración&nbsp; de permisos de Usuarios entre otros.<br></p>', 1, 1, 0, 1, 0, '2019-04-08 17:19:20', '2019-04-08 17:25:48', 1, 1),
	(28, 'Actividades', 6, 'flaticon-list', '<p>Actividades de MMAyA</p>', 0, 1, 0, 0, 0, '2019-10-31 14:14:17', '2019-11-09 00:30:43', 1, 1);
